import React, {useState,useEffect} from 'react';
import './App.css';

const App = () => {
  const [courses, setCourses] = useState<any[]>([]);

  useEffect(() => {
    fetch('http://localhost:3000/courses')
      .then(res => res.json())
      .then(obj => {
        console.log(courses);
        setCourses(courses);
      });
  },[]);

  return (
    <div className="App">
      {courses.map((item) => {return item.title;})}
    </div>
  );
}
